--
-- Name: get_day_name(timestamp without time zone); Type: FUNCTION; Schema: public; Owner: sinergi
--

CREATE FUNCTION get_day_name(_dtime timestamp without time zone) RETURNS character varying
    LANGUAGE plpgsql
    AS $$    
    DECLARE 
        _day VARCHAR(3);
    BEGIN
        
        IF date_part('hour', _dtime) < 9 THEN
            _dtime  := _dtime - interval '24 hours';
        END IF;
        
        SELECT lower(to_char(_dtime, 'Dy')) INTO _day;
        
        RETURN _day;
        
    END;
    $$;


