CREATE FUNCTION trg_node_update() RETURNS trigger
    LANGUAGE plpgsql
    AS $$
    DECLARE 
        
        -- Trigger data log
        -- 
        -- Author : Asep Maryana
        -- Email  : asep.maryana@gmail.com
