				END IF;
            ELSE
                UPDATE alarm_log SET dtime_end = _alarm_time WHERE id = _alarm_temp_id;
                DELETE FROM alarm_temp WHERE node_id = new.id AND alarm_list_id = _alarm_list_id;
            END IF;
            
        END IF;
		
		IF new.low_fuel <> old.low_fuel THEN
            
